import React from 'react'

const Header = (props) => {
    return (
      <div>
        <h1>Lutrivia</h1>
        <button onClick={props.newGame}>New Game</button>
        <p>Score: {props.score}</p>
        <p>How to play: Select either true or false for each question:</p>
      </div>
    )
}

export default Header
